import re
import numpy as np

def string_to_2d_array(input_string):
    # Use regular expressions to find all sets of parentheses
    pattern = re.compile(r'\(([^)]+)\)')
    matches = pattern.findall(input_string)

    # Parse each set of parentheses and convert to a list of floats
    rows = []
    for match in matches:
        row = list(map(float, match.split(',')))
        rows.append(row)

    # Convert the list of rows to a 2D NumPy array
    array = np.array(rows)
    return array


